import React, { useEffect,useState } from 'react';

const TableData = () => {
   
    const [show,setShow]=useState(false);
    let user="";
    useEffect(() => {
        
        fetch('/about')
            .then(res => res.json())
            .then(async (data) => {
                await console.log(data)
                console.log('done')

                const users=(data);
                 user=await users;
                setShow(true);
            })
    }, []);

    return (

        <>
            <h1>{show&&user}</h1>
        </>
    );
};

export default TableData;
